import React, { useState, useEffect } from 'react';
import { useWeb3React } from '@web3-react/core';
import { injected } from '../utils/connectors';

const NFTMarket = () => {
  const { active, account, activate } = useWeb3React();
  const [marketItems, setMarketItems] = useState([]);
  const [myNFTs, setMyNFTs] = useState([]);
  const [selectedTab, setSelectedTab] = useState('market');
  const [isLoading, setIsLoading] = useState(true);

  const connectWallet = async () => {
    try {
      await activate(injected);
    } catch (error) {
      console.error('Error connecting wallet:', error);
    }
  };

  // 模拟获取市场数据
  useEffect(() => {
    if (active) {
      // 这里应该从合约获取实际数据
      setMarketItems([
        { id: 1, type: 'SSR', power: 500, bonus: 50, price: 1.5, seller: '0x123...789' },
        { id: 2, type: 'SR', power: 300, bonus: 30, price: 0.8, seller: '0x456...012' },
        { id: 3, type: 'R', power: 200, bonus: 20, price: 0.5, seller: '0x789...345' }
      ]);

      setMyNFTs([
        { id: 4, type: 'SSR', power: 550, bonus: 55, listed: false },
        { id: 5, type: 'SR', power: 320, bonus: 32, listed: true, price: 0.9 }
      ]);

      setIsLoading(false);
    }
  }, [active]);

  const handleBuy = async (nftId) => {
    // 这里实现购买逻辑
    alert(`准备购买 NFT #${nftId}`);
  };

  const handleList = async (nftId) => {
    // 这里实现上架逻辑
    const price = prompt('请输入上架价格 (BNB):');
    if (price) {
      alert(`准备上架 NFT #${nftId} 价格: ${price} BNB`);
    }
  };

  const handleDelist = async (nftId) => {
    // 这里实现下架逻辑
    alert(`准备下架 NFT #${nftId}`);
  };

  return (
    <div className="max-w-6xl mx-auto bg-binance-dark p-6 rounded-lg shadow-lg">
      <h1 className="text-2xl font-bold text-binance-yellow mb-6">NFT 交易市场</h1>

      {!active ? (
        <button
          onClick={connectWallet}
          className="w-full bg-binance-yellow text-binance-dark font-bold py-3 px-4 rounded-lg hover:opacity-90 transition-opacity"
        >
          连接钱包
        </button>
      ) : (
        <div className="space-y-6">
          <div className="flex space-x-4 border-b border-gray-700">
            <button
              className={`px-4 py-2 ${
                selectedTab === 'market'
                  ? 'text-binance-yellow border-b-2 border-binance-yellow'
                  : 'text-gray-400'
              }`}
              onClick={() => setSelectedTab('market')}
            >
              市场列表
            </button>
            <button
              className={`px-4 py-2 ${
                selectedTab === 'my-nfts'
                  ? 'text-binance-yellow border-b-2 border-binance-yellow'
                  : 'text-gray-400'
              }`}
              onClick={() => setSelectedTab('my-nfts')}
            >
              我的NFT
            </button>
          </div>

          {isLoading ? (
            <div className="text-center py-8">加载中...</div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {selectedTab === 'market'
                ? marketItems.map(item => (
                    <div key={item.id} className="bg-gray-800 p-4 rounded-lg">
                      <div className="flex justify-between items-center mb-4">
                        <span className="text-binance-yellow font-bold">{item.type}</span>
                        <span className="text-sm text-gray-400">#{item.id}</span>
                      </div>
                      <div className="space-y-2 mb-4">
                        <p className="text-sm">基础算力: {item.power}</p>
                        <p className="text-sm">属性加成: +{item.bonus}%</p>
                        <p className="text-sm">卖家: {item.seller}</p>
                        <p className="text-lg font-bold text-binance-yellow">
                          {item.price} BNB
                        </p>
                      </div>
                      <button
                        onClick={() => handleBuy(item.id)}
                        className="w-full bg-binance-yellow text-binance-dark font-bold py-2 px-4 rounded-lg hover:opacity-90 transition-opacity"
                      >
                        购买
                      </button>
                    </div>
                  ))
                : myNFTs.map(nft => (
                    <div key={nft.id} className="bg-gray-800 p-4 rounded-lg">
                      <div className="flex justify-between items-center mb-4">
                        <span className="text-binance-yellow font-bold">{nft.type}</span>
                        <span className="text-sm text-gray-400">#{nft.id}</span>
                      </div>
                      <div className="space-y-2 mb-4">
                        <p className="text-sm">基础算力: {nft.power}</p>
                        <p className="text-sm">属性加成: +{nft.bonus}%</p>
                        {nft.listed && (
                          <p className="text-lg font-bold text-binance-yellow">
                            当前价格: {nft.price} BNB
                          </p>
                        )}
                      </div>
                      <button
                        onClick={() =>
                          nft.listed ? handleDelist(nft.id) : handleList(nft.id)
                        }
                        className="w-full bg-binance-yellow text-binance-dark font-bold py-2 px-4 rounded-lg hover:opacity-90 transition-opacity"
                      >
                        {nft.listed ? '下架' : '上架出售'}
                      </button>
                    </div>
                  ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default NFTMarket;
